import React, { useContext, useState } from 'react';
import { GameContext } from '../context/GameContext';

const allPieces = [
  'piece1.png', 'piece2.png', 'piece3.png', 'piece4.png',
  'piece5.png', 'piece6.png', 'piece7.png', 'piece8.png'
];

export default function Lobby() {
  const { player, setPlayer, players, gameState, socket } = useContext(GameContext);
  const [name, setName] = useState('');
  const [hasJoined, setHasJoined] = useState(false);
  const [selectedPiece, setSelectedPiece] = useState('');

  // 1. Join the lobby
  const joinLobby = () => {
    if (!name.trim()) return;
    setHasJoined(true);
    socket.emit('joinLobby', { name });
  };

  // 2. Pick your game piece
  const choosePiece = (piece) => {
    setSelectedPiece(piece);
    socket.emit('selectPiece', { piece });
  };

  // 3. Mark yourself ready
  const handleReady = () => {
    socket.emit('playerReady');
  };

  // Once the game has started, this component unmounts
  if (gameState === 'playing') return null;

  // Find your own player object in the lobby
  const me = player;
  const thisPlayer = me && players.find(p => p.socketId === me.socketId);
  const showReadyButton = thisPlayer && thisPlayer.piece && !thisPlayer.ready;

  // Prevent duplicate pieces
  const usedPieces = players.map(p => p.piece).filter(Boolean);
  const availablePieces = allPieces.filter(p => !usedPieces.includes(p));

  return (
    <div style={{
      display: 'flex', flexDirection: 'column',
      alignItems: 'center', justifyContent: 'center',
      height: '100vh', fontSize: '1.2rem'
    }}>
      <h2>Business Lobby</h2>

      {!hasJoined ? (
        <>
          <input
            placeholder="Enter your name"
            value={name}
            onChange={e => setName(e.target.value)}
            style={{ marginBottom: '1rem', fontSize: '1.2rem' }}
          />
          <button onClick={joinLobby}>Join Lobby</button>
        </>
      ) : !selectedPiece ? (
        <>
          <p>Select your game piece:</p>
          <div style={{
            display: 'flex', flexWrap: 'wrap',
            gap: '10px', justifyContent: 'center'
          }}>
            {availablePieces.map((piece, idx) => (
              <div key={idx} style={{ textAlign: 'center' }}>
                <img
                  src={`/pieces/${piece}`}
                  alt={piece}
                  style={{ width: 60, height: 60, cursor: 'pointer' }}
                  onClick={() => choosePiece(piece)}
                />
                <div>{piece.replace('.png', '')}</div>
              </div>
            ))}
          </div>
        </>
      ) : (
        <>
          <p>
            Welcome, <strong>{thisPlayer.name}</strong>! You’ve selected:{' '}
            <img
              src={`/pieces/${selectedPiece}`}
              alt={selectedPiece}
              style={{ width: 30 }}
            />
          </p>
          {showReadyButton
            ? <button onClick={handleReady}>Ready</button>
            : <p>Waiting for others...</p>}
        </>
      )}

      <hr style={{ width: '60%', margin: '2rem 0' }} />

      <h3>Players in Lobby:</h3>
      <ul style={{ listStyleType: 'none', padding: 0 }}>
        {players.map(p => (
          <li key={p.socketId} style={{ margin: '0.5rem 0' }}>
            {p.name}{' '}
            {p.piece && <img
              src={`/pieces/${p.piece}`}
              alt={p.piece}
              style={{ width: 20, verticalAlign: 'middle' }}
            />} {' '}
            {p.ready && '✅'}
          </li>
        ))}
      </ul>
    </div>
  );
}
